// Home.js
import React from 'react';
import SearchBar from './searchBar';
import Upload from './upload';

export default function Home({ renderResults }) {
  return (

    <div>
      <div id='search'>
        <SearchBar renderResults={renderResults} />
      </div>
      <div id='upload'>
        <Upload />
      </div>

    </div>
  );
}
